import { useGetPokemonByIdQuery } from "./counter/counterAPI.tsx";
import { useState } from "react";

export const Pokemon = ({id, children})=>
{
    function grabRelevant(json)
    {
        let result = {
            number: json.id,
            types: json.types,
            height: json.height,
            weight: json.weight,
            sprites: [json.sprites.versions["generation-i"], json.sprites.versions["generation-ii"], json.sprites.versions["generation-iii"], json.sprites.versions["generation-iv"], json.sprites.versions["generation-v"], json.sprites.versions["generation-vi"]],
            abilities: json.abilities,
        };
        return result;
    };

    const stats = grabRelevant((useGetPokemonByIdQuery(id)).data);

    return (
        <div>
            {JSON.stringify(stats)}
        </div>
    );
}

export default Pokemon;
